import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";


function clientesPDF(clientes) {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;

    const reportTitle = {
        columns: [
            {
                text: "Clientes",
                fontSize: 15,
                bold: true,
                margin: [0, 20, 0, 8], // left, top, right, bottom
            },
            {
                // Imagem "lfa-logo.png" convertida em base64 no site "https://www.base64-image.de/"
                image: "data:image/png;base64,",
                width: 100,
                height: 20,
                alignment: "right",
                margin: [0, 20, 10, 0], // left, top, right, bottom
                absolutePosition: { x: 105, y: 20 }, // left, top, right, bottom
            },
        ],
    };

    const dados = clientes.map((cliente) => {
        return [
            { text: cliente.id, fontSize: 9, margin: [0, 2, 0, 2] },
            { text: cliente.nome, fontSize: 9, margin: [0, 2, 0, 2] },
            { text: cliente.email, fontSize: 9, margin: [0, 2, 0, 2] },
            { text: cliente.fone, fontSize: 9, margin: [0, 2, 0, 2] },
        ];
    });
    
    //onde você coloca os stilos e tamanhos da header da tabela
    const details = [
        {
            table: {
                headerRows: 1,
                widths: ["*", "*", "*", "*"],
                
                body: [
                    [
                        { text: "Código", style: "tableHeader", fontSize: 10 },
                        { text: "Nome", style: "tableHeader", fontSize: 10 },
                        { text: "E-mail", style: "tableHeader", fontSize: 10 },
                        {
                            text: "Telefone",
                            style: "tableHeader",
                            fontSize: 10,
                        },
                    ],
                    ...dados,
                ],
            },
            layout: "headerLineOnly", // headerLineOnly
        },
    ];

    function Rodape(currentPage, pageCount) {
        return [
            {
                text: currentPage + " / " + pageCount,
                alignment: "right",
                fontSize: 9,
                margin: [0, 10, 20, 0], // left, top, right, bottom
            },
        ];
    }

    const docDefinitios = {
        pageSize: "A4",
        pageMargins: [15, 50, 15, 40],
        //watermark: { text: 'WorkGroup', color: 'blue', opacity: 0.3, bold: true, italics: false },
        header: [reportTitle],
        content: [details],
        footer: Rodape,
    };

    pdfMake.createPdf(docDefinitios).download();
}

export default clientesPDF;
